import logo from './logo2.svg';
import './App.css';
import HexagonGrid from 'react-hexagon-grid';
const openmoji = require('openmoji');

const om = openmoji.openmojis[99];
var len = openmoji.openmojis.length;
const hexagons = Array.from(Array(len).keys())
var image = "/images/" + String(om.hexcode) + ".svg";
console.log(image);

const gridWidth = window.screen.width;
const gridHeight = window.screen.height;


function App() {

  return (
    <div className="App">
      <header className="App-header">
        <img src={image} className="App-logo" alt="logo" />
        <HexagonGrid className="App-grid" gridWidth={500} gridHeight={500} hexagons={hexagons}
        />
        <p>
          Edit <code>src/App.js</code> and save to reload.
          Bet this looks pretty cool huh? {len}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
